import { createSlice } from "@reduxjs/toolkit";

export const GatherNumMafSlice = createSlice({
    name: "GatherNumMaf",
    initialState: {
        value: 2,
    },
    reducers: {
        incrementCivil: (state) => {
            state.value += 1;
        },

        decrementCivil: (state) => {
            state.value -= 1;
        },
    },
});

export const { incrementCrntCon, decrementCrntCon } = GatherNumMafSlice.actions;

export const selectConCnt = (state) => state.maf.value;

//equeal
// export const selectCount = function (state) {
//     return state.counter.value;
// };

export default GatherNumMafSlice.reducer;
